const Game = () => {
  return (
      <div class="App">
        <div class="TextBox">
          <h1 class="MainTitle">TicTacToe</h1>
          <p class="SubTitle">Game</p>

          <button id="HelpButton">Help</button>
        </div>
      </div>
  );
};

export default Game;
